solidGames.sol.content:
//SPDX-License-Identifier:MIT

pragma solidity ^0.8.0;

contract solidGames{
    address owner;
    constructor(){
        owner=msg.sender;
    }
    struct UserInfo{
        address user;
        string name;
        uint[] collection_id;
        uint noGame1;
        uint noGame2;
        uint noOfWinnerInGame1;
        uint noOfWinnerInGame2;
    }
    address[] users;
    mapping(address=>bool) isUserAdded;

    struct Game1{
        uint id;
        bool isWinner;
    }
    struct Game2{
        uint id;
        bool isWinner;
    }
    uint g1_id;
    uint g2_id;

    struct Collection{
        uint id;
        address user;
        string cid;
        string twitter;
        string discord;
        string mediumURL;
        string collectionURL;
        bool isGame1;
        bool isGame2;
        uint giveAways;
    }
    uint c_id;
    mapping(address=>UserInfo) public addressToUser;
    mapping(address=>Game1[]) public addressToGame1;
    mapping(address=>Game2[]) public addressToGame2;
    mapping(address=>Collection[]) public addressToCollectionCreated;
    mapping(uint => Collection) public idToCollection;
    mapping(uint=>address[]) public usersInCollection;

    function CreateProfile(string memory name) public{
        addressToUser[msg.sender].user = msg.sender;
        addressToUser[msg.sender].name=name;
    }

    function createCollection(string memory cid,string memory t,string memory d,string memory mu,
    string memory cu,bool g1,bool g2,uint giveaway) public{
        c_id +=1;
        addressToCollectionCreated[msg.sender].push(Collection(c_id,msg.sender,cid,t,d,mu,cu,g1,g2,giveaway));
        idToCollection[c_id]=Collection(c_id,msg.sender,cid,t,d,mu,cu,g1,g2,giveaway);
    }

    function participate(uint coll_id) public{        
        addressToUser[msg.sender].collection_id.push(coll_id);    
        usersInCollection[coll_id].push(msg.sender);    
    }

    function InGame(bool isWinner) public {
        uint len = getLengthOfUserCollections(msg.sender);

        if(addressToCollectionCreated[msg.sender][len-1].isGame1){
            g1_id += 1;
            addressToGame1[msg.sender].push(Game1(g1_id,isWinner));
            addressToUser[msg.sender].noGame1 += 1;
            if(isWinner){
                addressToUser[msg.sender].noOfWinnerInGame1 += 1;
            }
        }
        else{
            g2_id += 1;
            addressToGame1[msg.sender].push(Game1(g2_id,isWinner));
            addressToUser[msg.sender].noGame2 += 1;
            if(isWinner){
                addressToUser[msg.sender].noOfWinnerInGame2 += 1;
            }
        }
    }

    function getAllCollection(uint id) public view returns(Collection memory){
        return idToCollection[id];
    }
    function getLengthOfUserCollections(address user) public view returns (uint256) {
        return addressToCollectionCreated[user].length;
    }

    function getCollections(address user) public view returns(Collection memory){
        uint len = getLengthOfUserCollections(user);
        return addressToCollectionCreated[user][len-1];
    }    

    function getUserInfo() public view returns(UserInfo memory){
        return addressToUser[msg.sender];
    }

    function getCollectionId() public view returns(uint){
        return c_id;
    }
}

